import React from 'react';
import './MissionSection.css';

const MissionSection = () => {
  return (
    <section className="mission-section">
      <p className="mission-small">What We Are Doing</p>
      <h2 className="mission-main">We Are In A Mission To<br />Help The Helpless</h2>
      <p className="mission-description">Through innovative quantum computing education and hands-on learning experiences, we empower students from all backgrounds to explore the frontiers of technology. Our mission is to bridge the gap between theoretical knowledge and practical application, ensuring that the next generation of quantum pioneers comes from diverse communities worldwide.</p>
    </section>
  );
};

export default MissionSection;
